import React from "react";
import './App.css';
import Image from './Images/image(1).png'; // Correct path if you move the image into src folder

function App() {
  return (
    <>
      <div className="Par">
        <img src={Image} alt="My Image" />
      </div>
    </>
  );
}

export default App;
